import React, { Component } from "react";

class Favorites extends Component {
  render() {
    return (
      <div className="component-style">
        <h2>Favorites</h2>

        <div style={{border: "3px solid black", width: "200px", height: "200px"}}></div>
      </div>
    );
  }
}

export default Favorites;
